import React, { useState, useEffect } from "react";
import "../../App.css";
import Header from "../../Components/Header/Header";
import Intro from "../../Components/Intro/Intro";
import DoctorList from "../../Components/DoctorList/DoctorList";

const PatientPage = () => {
  const [doctorList, setDoctorList] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);

  useEffect(() => {
    async function getDoctors() {
      try {
        let docResponse = await fetch("/get_doctors");
        let doctors = await docResponse.json();
        setDoctorList(doctors);
        setIsLoaded(true);
      } catch (err) {
        console.log(err);
      }
    }
  }, []);

  if (isLoaded) {
    console.log(doctorList);
  }

  return (
    <div className="App">
      <Header portal="Patient Portal"></Header>
      <Intro></Intro>
      {/* {doctorList} */}
      <DoctorList firstName="Adam" lastName="Golding" id="1"></DoctorList>
      <DoctorList firstName="Horace" lastName="Pang" id="4"></DoctorList>
      <DoctorList firstName="Yash" lastName="Diwan" id="3"></DoctorList>
      <DoctorList firstName="William" lastName="Ling" id="2"></DoctorList>

      {/* <button>Log in as Patient</button>
        <button>Log in as Docotr</button> */}
    </div>
  );
};

export default PatientPage;
